import React from 'react'
const Profile = (props) => {
  return (
    <div style={{float:"right",marginRight:"1vw",textAlign:"center",height:"10vh",width:"8vw",border:"solid 1px black", borderRadius:"100px",padding:"2%",fontSize:"2vh" }}>
    <div>{props.Name}</div>
    </div>
  )
}

export default Profile
